  <>
    {sesion === true ? (
      <>
        <h1 className='Titulo1' style={{color:'blue'}}>Hello there {name}</h1>
        {apellido && <p>Tu apellido es {apellido}</p>}

        <h3>Lista de alumnos</h3>
